import React from 'react';
import Layout from '../../components/Layout';
import Header from '../../components/Header';

const Control = () => {
    return (
        <Layout>
            <title>Hik'UP Admin</title>
            <div>
                <style jsx>{`
                    .map-container {
                        position: absolute;
                        width: 100%;
                        height: 100%;
                    }
                    `}</style>
                    <div ref={this.mapContainer} className="map-container" />
                </div>
        </Layout>
    );
}

export default Control;
